/**
 * Represents information about a type of entity.
 * 
 * 表示有关实体类型的详细信息。
 */
export class EntityType {
    private constructor();
    /**
     * @remarks
     * Identifier of this entity type - for example,
     * 'minecraft:skeleton'.
     * 
     * 此实体类型的标识符 - 例如，'minecraft:skeleton'。
     */
    readonly id: string;
}